configure:
  commands:
    end:
      new_state: execute
    ipv6 multicast-routing: "ipv6 multicast-routing\r\n"
    ipv6 multicast-routing vrf green: "ipv6 multicast-routing vrf green\r\n%VPN Routing\
      \ instance green not enabled for address-family ipv6, or in deleting state.\r\
      \n"
    line console 0:
      new_state: configure_line
    no logging console: ''
  prompt: stack3-nyquist-1(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: stack3-nyquist-1(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: stack3-nyquist-1#
